  "designation": "Frontend Developer",
},
{
  "name": "Robert",
  "email": "robert@demo.com",
  "designation": "Backend Developer",
},
{
  "name": "Zac",
  "email": "zac@demo.com",
  "designation": "Ios Developer",
},
{
  "name": "David",
  "email": "david@demo.com",
  "designation": "Android Developer",
}]

const columns = [
  {
   name: "name",
   label: "Name",
   options: {
    filter: true,
    sort: true,
   }
  },
  {
   name: "email",
   label: "Email",
   options: {
    filter: true,
    sort: false,
   }
  },
  {
   name: "designation",
   label: "Designation",
   options: {
    filter: true,
    sort: false,
   }
  },];

function App() {
  return (
    <div className="App">
      <h1>MUI Datatable with react</h1>
      <MUIDataTable
        title={"Employee List"}
        data={data}
        columns={columns}
        options={options}
      />
    </div>
  );
}

export default App;
